  height: 50px;
  width: 50px;
  img {
    /* background-image: url('twitter-avi-default.png');
    background-size: cover;
    background-attachment: fixed;
    background-position: top;
    background-repeat: no-repeat; */
  }
`;

const TweetUserAvi = () => {
  return (
    <Container>
      <Avi>
        <img src='https://twirpz.files.wordpress.com/2015/06/twitter-avi-gender-balanced-figure.png' alt='err' />
      </Avi>
    </Container>
  );
};

export default TweetUserAvi;
